import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import Home from './components/Home';
import Navbar from './components/Navbar';
import TaskState from './context/TaskState';

function App() {
  return (
    <TaskState>
      <Navbar />
      <div className="App">
        <Home />
      </div>
    </TaskState>
  );
}

export default App;
